import Container from "../components/Container";
import Carousel from "../components/Carousel";
import NewItems from "../components/New_items";

const Index = () => {
  return (
    <Container title="Home">
      <Carousel />
      <NewItems />
      <div className="guarantee">
        <div className="cardGuarantee">
          <p>
              <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/envios_q0wcb4.png" alt="envios" />
          </p>
          <h4>Envíos y devoluciones</h4>
          <p>Entrega garantizada en máximo de 48 horas.</p>
        </div>
        <div className="cardGuarantee">
          <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/devolucion_m5gbfk.png" alt="garantia" />
          <h4>Garantía de devolución</h4>
          <p>Clientes 100% satisfechos.</p>
        </div>
        <div className="cardGuarantee">
          <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355700/maq_img/clientes_vjedk8.png" alt="satisfechos" />
          <h4>Clientes satisfechos</h4>
          <p>Ofrecemos la mejor variedad de productos.</p>
        </div>
      </div>
      <h1>Hola</h1>
    </Container>
  );
};

export default Index;
